import Layout from '../components/MyLayout.js'
import { Document } from 'react-pdf';

class Test extends React.Component {
  render() {
    return (
      <Document
        file={{
          url: "./resume.pdf"
        }}
        onLoadError={e =>
          console.log("Error while loading document! " + e.message)
        }
        onSourceError={e =>
          console.log("Error while loading document! " + e.message)
        }
      >
        <Page pageNumber={1} />
      </Document>
    );
  }
}

export default function Resume() {

  return (
    <Layout>
      <Test></Test>
    </Layout>
  )
}
